import React from "react";
import "./App.scss";
import { BrowserRouter as Router, Route } from "react-router-dom";
import SideBar from "../components/Sidebar";
import CreateArticle from "../components/articles/Create-Article";
import AllArticles from "../components/articles/AllArticles";
import Header from "../components/Header";
import Footer from "../components/Footer";
import AboutUs from "../components/About-Us";
import Show from "../components/articles/Show";
import Edit from "../components/articles/Edit";

const App = () => {
  return (
    <Router>
      <div id="page-wrap">
        <SideBar />
        <Header />
        <Route path="/" exact component={AllArticles} />
        <Route path="/api/articles/show/:id" exact component={Show} />
        <Route path="/api/articles/add" exact component={CreateArticle} />
        <Route path="/api/articles/edit/:id" exact component={Edit} />
        <Route path="/about" exact component={AboutUs} />
        <Footer />
      </div>
    </Router>
  );
};

export default App;
